i = 0
def main_spliter(s):
    global i
    def _sub_spliter(s):
        global i
        v = ord(s[i])
        if v >= 40:
            i += 1
            if v == 126: v = 58
            return v - 40
        else:
            kv = 39 - v
            v = 0
            for j in range(kv):
                v *= 86
                if v == 126: v = 58
                v += ord(s[j+1+i]) - 40
            i += kv + 1
            return v + 86
    v = _sub_spliter(s)
    c = s[i:i+v]
    i += v
    return c

def spliter_1(ss):
    a = len(ss)
    b = ord(ss[0]) - 68
    c = ''
    for i in ss[1:]:
        v = ord(i)
        if v >= 93 and v < 127:
            v += b
            if v >= 127:
                v -= 34
        elif v >= 65 and v < 92:
            v += b
            if v >= 92:
                v -= 27
        elif v >= 48 and v < 58:
            v += b
            if v >= 10:
                v -= 10
        c += chr(v)
    return c



def split_by_num(ss, num):
    ret = []
    for i in range(len(ss)//num):
        ret.append(ss[i*num:(i+1)*num])
    return ret


