def hl(a, b):
    c = bbox[5]
    s = c[ord(a[b])]
    if s < 82:
        return s
    l = 86 - s
    s = 0
    i = 0
    while i < l:
        s *= 86
        s += c[ord(a[b+1+i])]
        i += 1
    return s + 82
def az(a, b):
    c = bbox[5]
    c = c[ord(a[b])]
    if c < 82:
        return 1
    return 86 - c + 1

